import ast
def calculate_expression(integers, operations):
    expression = str(integers)[1:-1]
    for op in operations:
        expression = expression.replace(",", f" {op} ")
    return eval(expression)

# Testing the function
print(calculate_expression([2, 3, 4, 5], ['+', '*', '-']))
